element.attr({fill: color});", "actions": null }, { "tag": "clickArea", "stateRenderFunction": null, "actions": { "click": { "actionFunction": "ctx.api.callAction(event, 'click');" } } }, { "tag": "filterMode", "stateRenderFunction": "var defaultBorderColor = ctx.properties.defaultBorderColor;
var activeBorderColor = ctx.properties.activeBorderColor;
var defaultLabelColor = ctx.properties.defaultLabelColor;
var activeLabelColor = ctx.properties.activeLabelColor;
var boxBackground = ctx.properties.modeBoxBackground;

var running = ctx.values.running;
var filtrationMode = ctx.values.filtrationMode;

var filtrationMap = {};
var bottomShift = 104;
var rightShift = 226;
var middleShift = 121;

var filterModeSet = element.remember('filterModeSet');

var i = 0;
if (ctx.properties.filtrationMode) {
 i++;
 filtrationMap[i] = 'filter';
}
if (ctx.properties.wasteMode) {
 i++;
 filtrationMap[i] = 'waste';
}
if (ctx.properties.backwashMode) {
 i++;
 filtrationMap[i] = 'backwash';
}
if (ctx.properties.recirculateMode) {
 i++;
 filtrationMap[i] = 'recirculate';
}
if (ctx.properties.rinseMode) {
 i++;
 filtrationMap[i] = 'rinse';
}
if (ctx.properties.closedMode) {
 i++;
 filtrationMap[i] = 'closed';
}

if (!filterModeSet) {
 element.remember('filterModeSet', true);
 var clone = element.children()[0];
 setFilterModeColors(clone);
 element.clear();

 var filterMode = Object.values(filtrationMap);
 var lastToMiddle = filterMode.length % 2;

 filterMode.forEach((mode, index, arr) => {
 var template = clone.clone();
 var x = (index % 2) * rightShift;
 var y = Math.floor((index % filterMode.length) / 2) * bottomShift;
 if (index === filterMode.length-1 && lastToMiddle) {
 x = middleShift;
 }
 template.attr({'class': mode}).css('cursor', 'pointer').translate(x, y);
 ctx.api.text(template.findOne('text'), capitalizeFirstLetter(mode));
 template.click((event) => click(event, getFilterModeKey(mode)));
 element.add(template);
 })
}

if (isFinite(filtrationMode)) {
 if (element.findOne('.active')) {
 setFilterModeColors(element.findOne('.active'));
 }
 setFilterModeColorsByMap(filtrationMode, running);
}

function click(event, index) {
 var filtrationMode = ctx.values.filtrationMode;
 if (ctx.values.running && isFinite(filtrationMode)) {
 ctx.api.disable(element.children());
 var newValue = +index;
 if (newValue === filtrationMode) {
 newValue = 0;
 } else {
 setFilterModeColorsByMap(filtrationMode);
 }
 ctx.api.setValue('filtrationMode', newValue);
 ctx.api.callAction(event, 'filtrationModeUpdateState', newValue, {
 next: () => {
 setFilterModeColorsByMap(newValue ? newValue: filtrationMode, newValue);
 ctx.api.enable(element.children());
 },
 error: () => {
 setFilterModeColorsByMap(newValue);
 ctx.api.setValue('filtrationMode', filtrationMode);
 ctx.api.enable(element.children());
 }
 });
 }
}

function getFilterModeKey(value) {
 return Object.keys(filtrationMap).find(key => filtrationMap[key] === value);
}

function setFilterModeColorsByMap(mode, active = false) {
 var filterBox = element.findOne('g.'+filtrationMap[mode])
 if (filterBox) {
 return setFilterModeColors(filterBox, active);
 }
}

function setFilterModeColors(filterBox, active = false) {
 if (filterBox) {
 if (active) {
 filterBox.addClass('active');
 } else {
 filterBox.removeClass('active');
 }
 var borderColor = active ? activeBorderColor : defaultBorderColor;
 var labelColor = active ? activeLabelColor : defaultLabelColor;
 filterBox.children()[0].fill(boxBackground);
 filterBox.children()[1].stroke(borderColor);
 filterBox.children()[2].fill(borderColor);
 ctx.api.font(filterBox.findOne('text'), null, labelColor);
 }
}

function capitalizeFirstLetter(string) {
 return string.charAt(0).toUpperCase() + string.slice(1);
